import React from 'react';
import styled from 'styled-components';
const Nav = () => {
    return (
        <NavStyled>
            <h1>Nav 1</h1>
            <h2>Nav 2</h2>
            <h3>Nav 2</h3>
        </NavStyled>
    );
}

export default Nav;

const NavStyled = styled.nav ` 
       h1 {
            background-color: lavender;
       } 
       h2 {
            background-color: blue;
       } 
       h3 {
            background-color: red;
       } 

`;
